import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import MainPage from './pages/MainPage';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
  return (

  <BrowserRouter>
        {/* <div className="App"> */}
          <Header />
          <Routes>
            <Route path='/' element={<MainPage />} />
          </Routes>
          <Footer />
        {/* </div> */}
  </BrowserRouter>
  );
}

export default App;
